import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TablePagination from '@material-ui/core/TablePagination';
import TableRow from '@material-ui/core/TableRow';

export default function TokenOwnershipTable() {
  const [data, setData] = useState([]);
  const [formValues, setFormValues] = useState({
    owner: "",
    status: "unminted",
    claimedBy: "",
  });
  const [page, setPage] = useState(0);
  const [rowsPerPage, setRowsPerPage] = useState(10);

  useEffect(() => {
    axios.get('/api/data')
      .then(res => setData(res.data))
      .catch(err => console.error(err));
  }, []);

  const handleChange = e => {
    setFormValues({
      ...formValues,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = e => {
    e.preventDefault();
    console.log(formValues);
    // Perform your search/filter operation here
  };

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = event => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setPage(0);
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <input name="owner" value={formValues.owner} onChange={handleChange} placeholder="Owner" />
        <select name="status" value={formValues.status} onChange={handleChange}>
          <option value="unminted">Unminted</option>
          <option value="minted">Minted</option>
          <option value="claimed">Claimed</option>
        </select>
        <input name="claimedBy" value={formValues.claimedBy} onChange={handleChange} placeholder="Claimed By" />
        <button type="submit">Search</button>
      </form>

      <TableContainer>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>ID</TableCell>
              <TableCell>Created By</TableCell>
              <TableCell>Status</TableCell>
              <TableCell>Claimed By</TableCell>
              <TableCell>Created At</TableCell>
              <TableCell>Token ID</TableCell>
              <TableCell>Owner</TableCell>
              <TableCell>Internal Token ID</TableCell>
              <TableCell>Serial Number</TableCell>
              <TableCell>Contract</TableCell>
              <TableCell>Category</TableCell>
              <TableCell>Block Updated</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {data.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage).map(row => (
              <TableRow key={row.id}>
                <TableCell>{row.id}</TableCell>
                <TableCell>{row.createdBy}</TableCell>
                <TableCell>{row.status}</TableCell>
                <TableCell>{row.claimedBy}</TableCell>
                <TableCell>{row.created_at}</TableCell>
                <TableCell>{row.tokenId}</TableCell>
                <TableCell>{row.owner}</TableCell>
                <TableCell>{row.internalTokenId}</TableCell>
                <TableCell>{row.serialNumber}</TableCell>
                <TableCell>{row.contract}</TableCell>
                <TableCell>{row.category}</TableCell>
                <TableCell>{row.blockUpdated}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
}
